// Props Guide: 
// Link: link of current page
// Type: User type


import React, { Profiler, useState } from "react";
import '../styles/global/Dashboardnav.css'
import { Link, Route, Routes } from "react-router-dom";
import { useSignOut } from "react-auth-kit";
import { useNavigate } from "react-router-dom";
import axios from 'axios'
import { useAuthUser } from "react-auth-kit"


function Dashboardnav(props) {

    const auth = useAuthUser()
    const signOut = useSignOut()
    const navigate = useNavigate()

    const [type, setType] = useState(props.Type)
    const [link, setLink] = useState(props.link)

    const handleLogout = async () => {
        axios.post(`${process.env.REACT_APP_ROUTE}/api/affiliate/logout`, {
            id: auth().id
        }).then((res) => {
            if (res.status == 200) {
                navigate("/affiliate/login");
                setTimeout(() => {
                    signOut();
                }, 1000);
            }
        }).catch(err => alert(err))
    };

    const handleLink = (link) => {
        navigate(link)
        navigate(0)
    }

    return (
        <div className="dashboard-nav-section-container">

            {type == 'Affiliate' && (
                <div className="dashboard-affilaite-top-nav">
                    <Link className={link == "My Profile"? "active" : ""} onClick={() => handleLink('/dashboard/affiliate/profile')}>My Profile</Link>
                    <Link className={link == "Campaigns"? "active" : ""} to={'/dashboard/affiliate/campaigns'}> Campaigns</Link>
                    <Link className={link == "Influencer Hub"? "active" : ""} to={'/dashboard/affiliate/influencerhub'}>Influencer Hub</Link>
                </div>
            )}

            <hr className="dashboard-affiliate-separator"/>

            <div className="dashboard-affilaite-bottom-nav">
                <Link className={link == "Account Settings"? "active" : ""} to={'/'}>Account Settings</Link>
                <Link className={link == "Help Center"? "active" : ""} to={'/'}> Help Center</Link>
                <a onClick={handleLogout}>Logout </a>
            </div>
        </div>
    )
}

export default Dashboardnav;
